class Solution(object):
    def findTheDifference(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        dic = {}
        for ele in s:
            if not dic.get(ele):
                dic[ele] = 1
            else:
                dic[ele] = dic[ele] + 1

        add_letter = ""
        for ele in t:
            if dic.get(ele, 0): #没有或者为0
                dic[ele] -= 1
            else:
                add_letter += ele
        return add_letter


class Solution(object):
    def findTheDifference(self, s, t):
        s_total = 0
        for ele in s:
            s_total += ord(ele)

        t_total = 0
        for ele in t:
            t_total += ord(ele)

        return chr(abs(s_total - t_total))

class Solution(object):
    def findTheDifference(self, s, t):
        total = 0
        for ele in s:
            total ^= ord(ele)

        for ele in t:
            total ^= ord(ele)

        return chr(total)


if __name__ == '__main__':
    s = "abcd"
